import React from 'react'
import Home from './Room'

export default function HomesList({homes}) {
    if(homes.length ===0){
        return(
            <div className="empty-search">
                <h3>unfortunately no homes matched your search parameters</h3>
            </div>
        )
    }
    return <section className="homeslist">
        <div className="homeslist-center">
            {
                homes.map(item=> {
                    return <Home key={item.id} home={item}/>;
                })
            }
        </div>
        </section>;
}
